    "parker-river-national-wildlife-refuge-narrative-report-may-june-july-august-1943",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Parker River
    National Wildlife Refuge outlines Refuge accomplishments from May through August
    of 1943. The report begins by summarizing the weather conditions, water conditions,
    and food and cover during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
    is also covered. Resource management is outlined; topics include haying. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes Refuge visitors. N-R forms  are attached.",nt"license_title":
